template<typename GFX>
inline void draw_icon_xbm(GFX& d, int16_t x, int16_t y,
    IconId id, uint16_t color) {
    switch (id) {
    case ICON_WEATHER_SUNNY:
        d.drawXBitmap(x, y, weather_sunny_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_PARTLY_CLOUDY:
        d.drawXBitmap(x, y, weather_partly_cloudy_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_CLOUDY:
        d.drawXBitmap(x, y, weather_cloudy_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_FOG:
        d.drawXBitmap(x, y, weather_fog_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_POURING:
        d.drawXBitmap(x, y, weather_pouring_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_SNOWY:
        d.drawXBitmap(x, y, weather_snowy_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_LIGHTNING:
        d.drawXBitmap(x, y, weather_lightning_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_NIGHT:
        d.drawXBitmap(x, y, weather_night_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_NIGHT_PARTLY_CLOUDY:
        d.drawXBitmap(x, y, weather_night_partly_cloudy_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_WEATHER_WINDY_VARIANT:
        d.drawXBitmap(x, y, weather_windy_variant_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_NEW:
        d.drawXBitmap(x, y, moon_new_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_WAXING_CRESCENT:
        d.drawXBitmap(x, y, moon_waxing_crescent_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_FIRST_QUARTER:
        d.drawXBitmap(x, y, moon_first_quarter_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_WAXING_GIBBOUS:
        d.drawXBitmap(x, y, moon_waxing_gibbous_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_FULL:
        d.drawXBitmap(x, y, moon_full_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_WANING_GIBBOUS:
        d.drawXBitmap(x, y, moon_waning_gibbous_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_LAST_QUARTER:
        d.drawXBitmap(x, y, moon_last_quarter_24x24_bits, ICON_W, ICON_H, color);
        break;
    case ICON_MOON_WANING_CRESCENT:
        d.drawXBitmap(x, y, moon_waning_crescent_24x24_bits, ICON_W, ICON_H, color);
        break;
    default: break;
    }
}
